//pragma solidity  ^0.5.0;
pragma solidity >=0.5.0 < 0.7.0;// 0.6.6;

import './Token.sol';

contract EternalSwap {

     string public name = "EternalSwap Exchange";
     Token public token;
     uint  public rate = 100; //1 ether = 100 ETN

     event TokensPurchase(
          address account,
          address token,
          uint amount,
          uint rate
     );

      event TokensSold(
          address account,
          address token,
          uint amount,
          uint rate
     );

     constructor(Token _token) public {
         token = _token; //token address
     }

     function buyTokens() public payable {
          // Redemption rate = # of tokens they receieve for 1 ether
          //Amount of Ethereum * Redemption rate
          uint tokenAmount = msg.value * rate;

          require(token.balanceOf(address(this)) >= tokenAmount);
          token.transfer(msg.sender, tokenAmount);
          emit TokensPurchase(msg.sender,address(token),tokenAmount,rate);
     }

     //transfer tokens from investor to eternalSwap 
     //and give the investor ether
     function sellTokens(uint tokenAmount) public {
            //User cant sell more token than they have
          require(token.balanceOf(msg.sender) >= tokenAmount);

          uint etherAmount = tokenAmount / rate;

          //ensure that eternalSwap contract has enough balance to buy back the tokens
          require(address(this).balance >=etherAmount);

          //use this when you want a smart contract to spend your tokens
          token.transferFrom(msg.sender, address(this), tokenAmount);

          msg.sender.transfer(etherAmount);

          emit TokensSold(msg.sender,address(token),tokenAmount, rate);
     }

}
